function waithalfsecandretry(image){
    window.setTimeout(function (){ waitFor(image)},500);
}

function waitFor(image){
	if((image.height == '60') && (image.width == '250'))
	{
		window.setTimeout(function (){ dothedecoding()},2000);		
	}	else	{
		waithalfsecandretry(image);
	}
}


