function rotate(letter) {

newFigure = new Array();
        var lengthX = letter.length;
		var heigthY = letter[0].length;
		for(var i=0; i<heigthY; ++i)	{			
			newFigure[i] = new Array();			
			for(var j=0; j<lengthX; ++j)	{				
				newFigure[i] += letter[j][i];
			}
		}
	var horizontalre = new RegExp('{' + (newFigure[0].length) + '}');
	newFigure.splice(newFigure.indexOf(horizontalre), 1);

	    for(var i=0; i<newFigure.length; ++i)	{
			
			if (horizontalre.test(newFigure[i])){
		       newFigure.splice(i, 1);
			   i--;
		     }
		}
 return(newFigure);
}

function find_smaller_accurate(accurate){		
var j = 0;
for (var i=1; i < accurate.length; i++) {
  if (accurate[i] < accurate[j]){
    j = i;
	}
}

x = 100 *( parseInt(accurate[j])/30);
return x;
}

function find_sum_accurate(accurate){		
var j = 0;
for (var i=0; i < accurate.length; i++) {
    j += parseInt(accurate[i]);
}
         
var x = 100 * (j/(30*accurate.length));
return parseInt(x);;
}

