			Parameters["letteranalogia"] = letteranalogia;
			Parameters["letterCharacteristics"] = letterCharacteristics;
			letterspecificcharacter = [letterwidth, letterheight, letteranalogia];
			letterspecificcharacter = letterspecificcharacter.concat(letterCharacteristics);
			var thinkofThisLetter = FunctionThinkofThisLetter(letterspecificcharacter);
			Parameters["thinkofThisLetter"] = thinkofThisLetter;
			var letter = rotated[x].join('\n');	
