function removeBorder(dots,width,height)
{
var re = new RegExp('({' + width + '}(?:\n|$))', 'g');
var re2 = new RegExp('(.{' + (width-2) + '})(?:\n|$)', 'g');
dots = dots.replace(re,'');
dots = dots.replace(re2,'$1\n');
dots = dots.replace(/\n$/,'');

var re3 = new RegExp('({' + width + '}(?:\n|$))', 'g');
var re4 = new RegExp('(.{' + (width-2) + '})(?:\n|$)', 'g');
dots = dots.replace(re3,'');
dots = dots.replace(re4,'$1\n');
dots = dots.replace(/\n$/,'');

	height = height-3;
	width = width-2;	

return putEmInArray(dots,width,height);
}


function imageToText(image_data){
	a = new Array();
	a = image_data.data;
	width = image_data.width;
	height = image_data.height;
	b = a.join("");
	//GM_log(b);
  b=b.replace(/000255/g,'');
  b=b.replace(/255255255255/g,'');
  b=b.replace(/...$/g,'');
  var re = new RegExp('(.{' + width + '})', 'g');
  dots=b.replace(re,'$1\n');
  return removeBorder(dots,width,height);
}


function convert_grey(image_data)
  {
    for (var x = 0; x < image_data.width; x++)
      {
        for (var y = 0; y < image_data.height; y++)
          {
            var i = x*4+y*4*image_data.width;
            var luma = Math.floor(image_data.data[i] * 299/1000 + image_data.data[i+1] * 587/1000 + image_data.data[i+2] * 114/1000);
            image_data.data[i] = luma;
            image_data.data[i+1] = luma;
            image_data.data[i+2] = luma;
            image_data.data[i+3] = 255;
          }
      }
  return image_data;
  }

function removeColor(image_data, red,green,blue, alfa, tolerance)
{	
	for (x = 0; x < (image_data.width*image_data.height); x++)
	{
     var i = x*4;
       if ((image_data.data[i] <= (red+tolerance)) && (image_data.data[i] >= (red-tolerance)) && 
       		(image_data.data[i+1] <= (green+tolerance)) && (image_data.data[i+1] >= (green-tolerance)) && 
       		(image_data.data[i+2] <= (blue+tolerance))  && (image_data.data[i+2] >= (blue-tolerance)) )
       	{
                   image_data.data[i] = 255;
                   image_data.data[i+1] = 255;
                   image_data.data[i+2] = 255;
                   image_data.data[i+4] = 255; 
       	}else{
       		       image_data.data[i] = 0;
                   image_data.data[i+1] = 0;
                   image_data.data[i+2] = 0;
                   image_data.data[i+4] = 255; 
       	} 
	}
}


